    false,nt"url": null,nt"notes": "Slope is derived from gridded (5 m cell
    size) bathymetry from four sources: Multibeam bathymetry collected by Coral Reef
    Ecosystem Division aboard NOAA R/V AHI, and NOAA Ship Hi'ialakai; multibeam bathymetry
    collected in Apra Harbor by the Naval Oceanographic Office and NOAA Office of Coast
    Survey; lidar collected by the Naval Oceanographic Office; and lidar collected by
    the Joint Airborne Lidar Bathymetry Technical Center of Expertise. Cell values reflect
    the maximum rate of change (in degrees) in elevation between neighboring cells derived
    with the ArcGIS Spatial Analyst extension. This data set is for the US Territory
